(3, 'About Us', 'music-circle', 1, 1, 1, 'About Us', '<h1>About Us <br></h1><p></p><p>Acoustie.com is a unique online music platform founded by a musician with a passion for discovering new talent and sharing music with the world, including a focus on acoustic music but also other music genres. Our platform is dedicated to providing a space for emerging artists to showcase their music and for music lovers to discover new and exciting sounds.</p><p>At Acoustie.com, our mission is to support independent artists and foster a community that celebrates creativity, authenticity, and originality. Our platform offers a vast array of music genres, including but not limited to acoustic music, indie, folk, singer-songwriter, and many more. All the songs available on our website are uploaded by the artists themselves, giving users a chance to connect directly with the creators of the music they love.</p><p>Our platform provides a unique opportunity for emerging artists to showcase their talent and connect with an engaged audience. By offering a platform for independent artists to showcase their music, we aim to create a supportive community that fosters creativity and originality. We believe in the power of music to bring people together, and our platform reflects that belief.</p><p>Whether you\'re an emerging artist looking to showcase your music, or a music lover looking for something new and exciting, Acoustie.com is the perfect platform for you. Join our community today and discover the magic of acoustic music!</p>', '/about-us', 'Read more about us', '2023-02-24 01:06:20', '2023-02-24 18:39:39'),
(4, 'Privacy Policy', 'music-circle', 1, 1, 0, 'Privacy policy', '<h1>Privacy policy</h1><p>&nbsp;</p><p>Acoustie.com takes the privacy of our website visitors seriously and strives to be transparent about how we use your personal information.</p><p>&nbsp;</p><p>What Information Do We Collect?</p><p>When you visit our website, we automatically collect some information about you. This may include your IP address, browser, device type, operating system, date and time of your visit, and URLs of the pages you visit. We use this information to monitor and improve the functionality and performance of our website. Additionally, when you sign up or make a purchase on our website, we may collect personal information such as your name, email address, phone number, and payment information.</p><p>How Do We Use Your Personal Information?</p><p>We will only use your personal information to provide services related to our website. These services may include processing orders, providing customer support, and sending newsletters or promotional emails. We will never sell or rent your personal information to third parties. However, we may share your information with our service providers or partners who help us provide our services.</p><p>How Do We Protect Your Information?</p><p>We use appropriate security measures to protect your personal information from unauthorized access or disclosure. However, no security system is foolproof, and we cannot guarantee the absolute security of your information. Therefore, you use our website at your own risk.</p><p>Changes to Our Privacy Policy</p><p>We may update our privacy policy from time to time to reflect changes in our practices or legal requirements. We encourage you to review this policy periodically to stay informed about how we protect your privacy.</p><p>&nbsp;</p><p>Contact Us</p><p>If you have any questions or concerns about our privacy policy, please contact us at privacy@acoustie.com.</p>', '/privacy-policy', 'Read about our privacy policy', '2023-02-24 01:06:20', '2023-02-24 19:00:54'),
(5, 'Terms of Service', 'music-circle', 1, 1, 0, 'Terms of Service', '<h1>Terms of Service</h1><p><br></p><p>Terms of Use Policy:</p><p>&nbsp;</p><p>Welcome to Acoustie.com (the \"Website\"). By accessing or using our Website, you agree to the following terms and conditions:</p><p>Copyright Ownership: Users agree that they own the copyright to all content uploaded to our Website. Users acknowledge that any legal obligations arising from the infringement of copyright are solely their responsibility. Acoustie.com respects the intellectual property rights of others and expects our users to do the same. If we receive a valid notice of copyright infringement, we will remove the content in question and take appropriate action.</p><p>Digital Products: All digital products available on our Website are final sale and non-refundable. Once a user has purchased a product, they acknowledge that they will not be able to receive a refund. Acoustie.com reserves the right to modify or discontinue any digital product at any time without notice.</p><p>User Conduct: Users must use our Website for lawful purposes only. Users must not use our Website to post or transmit any material which violates the rights of others, is defamatory, abusive, offensive, or is in any way illegal. Users must not use our Website to promote or solicit any commercial activity without our prior written consent.</p><p>Termination: We reserve the right to terminate or suspend any user account at any time, for any reason, without notice. Acoustie.com may also remove any content or material posted by a user at our sole discretion.</p><p>Disclaimer of Warranties: Acoustie.com makes no representation or warranty of any kind, express or implied, as to the operation of our Website, the information, content, materials, or products included on our Website. We do not warrant that our Website will be uninterrupted, error-free, or free of viruses.</p><p>Limitation of Liability: We will not be liable for any damages arising from the use of our Website or the inability to use our Website. We will not be liable for any direct, indirect, incidental, or consequential damages. In no event shall Acoustie.com\'s total liability to any user for all damages, losses, or causes of action exceed the amount paid by the user to Acoustie.com for the product or service in question.</p><p>Governing Law: These terms and conditions shall be governed by and construed in accordance with the laws of the Republic of Turkey. Any dispute arising out of or related to these terms and conditions shall be resolved in the courts of the Republic of Turkey.</p><p>Updates: We reserve the right to update and modify these terms and conditions at any time without prior notice. By continuing to use our Website, you agree to the most current version of the terms and conditions. If you do not agree to any changes made to the terms and conditions, you must stop using our Website immediately.</p>', '/terms-of-service', 'Terms of Service page description', '2023-02-24 01:06:20', '2023-02-24 19:41:12'),
