(7, 'Account Creation Agreement', 'music-circle', 1, 1, 1, 'Account Creation Agreement', '<h1>Account Creation Agreement</h1><p></p><p></p><p>This Agreement is between you (\"you\" or \"your\") and Acoustie.com (\"Acoustie,\" \"we,\" \"our,\" or \"us\") regarding your use of the Acoustie.com platform and services (\"Services\"). By creating an account with Acoustie.com, you agree to be bound by the terms of this Agreement. If you do not agree to the terms of this Agreement, you may not create an account with Acoustie.com.</p><ol><li><p>Eligibility To create an account with Acoustie.com, you must be at least 13 years of age or have the consent of a parent or legal guardian. By creating an account, you represent and warrant that you are at least 13 years of age or have the consent of a parent or legal guardian.</p></li><li><p>Account Information When creating an account with Acoustie.com, you must provide accurate and complete information. You are solely responsible for the activity that occurs on your account, and you must keep your account information up-to-date at all times. You agree that you will not create an account for anyone other than yourself without their express permission.</p></li><li><p>User Content By creating an account with Acoustie.com, you acknowledge that you may be submitting user-generated content, including but not limited to audio recordings, images, and comments (\"User Content\"). You retain all ownership rights to your User Content, but you grant Acoustie.com a worldwide, non-exclusive, royalty-free, sub-licensable, and transferable license to use, reproduce, distribute, prepare derivative works of, display, and perform your User Content in connection with the Services.</p></li><li><p>Prohibited Activities When using the Services, you agree not to engage in any of the following activities:</p></li></ol><ul><li><p>Using the Services for any unlawful purpose or in violation of any applicable laws or regulations</p></li><li><p>Impersonating any person or entity, or falsely representing your affiliation with any person or entity</p></li><li><p>Interfering with or disrupting the Services or servers or networks connected to the Services</p></li><li><p>Uploading or sharing any content that is unlawful, obscene, defamatory, or otherwise offensive</p></li></ul><ol start=\"5\"><li><p>Indemnification You agree to indemnify and hold Acoustie.com harmless from any claims, losses, damages, liabilities, costs, and expenses (including reasonable attorneys\' fees) arising out of or related to your use of the Services or any violation of this Agreement.</p></li><li><p>Termination Acoustie.com reserves the right to terminate your account or restrict your access to the Services at any time, with or without notice, for any reason or no reason at all.</p></li><li><p>Governing Law This Agreement shall be governed by and construed in accordance with the laws of the State of California, without giving effect to any principles of conflicts of law.</p></li><li><p>Entire Agreement This Agreement constitutes the entire agreement between you and Acoustie.com regarding your use of the Services, and supersedes all prior or contemporaneous communications, whether oral or written.</p></li><li><p>Amendments Acoustie.com may amend this Agreement at any time by posting a revised version on the Acoustie.com website. Your continued use of the Services following such changes constitutes your acceptance of the revised Agreement.</p></li></ol><p>By creating an account with Acoustie.com, you agree to be bound by the terms of this Agreement. If you have any questions or concerns, please contact us at <a href=\"mailto:info@acoustie.com\" target=\"_new\" rel=\"noopener noreferrer nofollow\"><u><strong>info@acoustie.com</strong></u></a>.</p><p>Last updated: [02.25.2023]</p>', '/account-creation-agreement', 'Account Creation Agreement', '2023-02-24 19:55:13', '2023-02-24 19:56:52'),
(9, 'DMCA', 'dmca', 1, 1, 1, 'DMCA', '<h1>DMCA Notification of Copyright Infringement</h1><p></p><p></p><p>[Company Name / Copyright Owner\'s Name and Address] (\"Complainant\") hereby submits this DMCA Notification of Copyright Infringement to report alleged infringement of copyright in material available on the Acoustie.com (\"Site\"):</p><ol><li><p>A description of the copyrighted work claimed to have been infringed;</p></li><li><p>A description of the material on the Site that is claimed to be infringing and its location on the Site;</p></li><li><p>The name and contact information of the copyright owner whose work is claimed to be infringed;</p></li><li><p>A statement that the complaining party has a good faith belief that the use of the material in the manner complained of is not authorized by the copyright owner, its agent, or the law;</p></li><li><p>A statement that the information in the notification is accurate, and under penalty of perjury, that the complaining party is authorized to act on behalf of the owner of an exclusive right that is allegedly infringed;</p></li><li><p>The complainant\'s signature.</p></li></ol><p>We hereby state that the information provided in this notification is accurate and that we have the authority to act on behalf of the owner of an exclusive right that is allegedly infringed. We acknowledge that under 17 U.S.C. § 512(f) any person who knowingly materially misrepresents that material or activity is infringing may be subject to liability for damages.</p><p>Please note that all content uploaded to the Site is uploaded by users, who agree that they own the copyright to the content they upload when they register and upload the content. If you claim to own the copyright to a piece of content on the Site, please send us a document proving your ownership of the content, in addition to the DMCA Notification of Copyright Infringement.</p><p>Copyright owner or an authorized agent may send this DMCA Notification of Copyright Infringement to the following address:</p><p>Email: [<a href=\"mailto:legal@acoustie.com\" target=\"_new\" rel=\"noopener noreferrer nofollow\"><u><strong>legal@acoustie.com</strong></u></a>.]</p><p>[Acoustie.com]</p><p>Date: [02-27-23]</p><hr><p>At Acoustie.com, we respect the intellectual property rights of others and take copyright infringement seriously. Copyright owners or authorized agents can send a DMCA notification of copyright infringement, including the information listed above and proof of ownership, to <a href=\"mailto:legal@acoustie.com\" target=\"_new\" rel=\"noopener noreferrer nofollow\"><u><strong>legal@acoustie.com</strong></u></a>.</p>', '/dmca', 'DMCA', '2023-02-26 21:11:49', '2023-02-26 21:28:40'),
(10, 'Earn', 'music-circle', 1, 1, 1, 'Earn', '<h1>Earn Money from Your Music</h1><h1></h1><p></p><p>Welcome to Acoustie, a platform designed to help musicians and music lovers connect while supporting the music industry. Our mission is to provide a space where musicians can earn a living doing what they love, without having to compromise their artistic vision.</p><p>As a musician on Acoustie, you can earn royalties by uploading your music to the site. For every 100 listens, you earn 1 cent in royalties. Additionally, if you choose to offer your music for sale, you can set your own prices and keep 90% of the profits. We take a 10% commission on all sales, but we believe this is a fair price for the services we provide.</p><p>For music lovers who want to support their favorite artists, we offer a premium membership that allows them to listen to music ad-free and download unlimited amounts of music from artists who offer their music for free. Premium members can also support their favorite artists by purchasing their music at a price set by the artist.</p><p>To start earning royalties on Acoustie, all you need to do is create an account and upload your music. You can upload up to 500 MB of music through the artist panel, where you can also set your own prices for your music. Additionally, you can ask your fans to support you by offering your music for sale at a reduced price or by allowing them to make donations to you directly through the site.</p><p>At Acoustie, we believe in the power of music to bring people together and to inspire creativity. We are committed to supporting artists and musicians by providing a platform that allows them to share their work with the world while earning a fair wage for their efforts. So if you\'re a musician looking to make a living doing what you love, we invite you to join us and become a part of our community today.</p><p>Thank you for supporting Acoustie and for supporting the arts. Let\'s work together to create a world where musicians and artists can thrive and make a living doing what they love.</p><p></p><h2>Acoustie: The Platform for Musicians Who Care About Their Craft, Not Just Money</h2><h2></h2><p></p><p>We\'re not in this for the money. Our founder is a musician herself, and she knows firsthand the struggles that musicians face when trying to earn a living from their art. That\'s why we\'ve created a platform that\'s designed to support musicians and help them earn a fair wage from their music. We take a modest commission on sales, but our main focus is on creating a space where musicians can thrive and connect with their audience.</p><p>If you\'re a musician looking for a platform that\'s dedicated to your success, then we invite you to join us at Acoustie. Our platform is designed to be easy to use, and we offer a range of features that make it simple for you to share your music with the world. Whether you\'re a new artist looking to get your music out there, or an established musician looking for a platform that will help you connect with your audience and earn money from your music, we\'re here to support you every step of the way. So why not give us a try and see how we can help you take your music to the next level?</p>', '/earn-money-from-your-music', 'Make money by making, playing and selling music', '2023-02-28 18:55:54', '2023-02-28 19:07:14');
